import React from "react";
import Content from "./Content";

function Home() {
  return (
    <>
      <Content
        fline="Blockchain Revolution with"
        sline=" BlockEase"
        tline="We can provide the knowledge about Blockchain Technology"
        b_content="Get Started"
        link="service"
        image
      />
    </>
  );
}

export default Home;
